/// folderName : "WhatsApp Images"

class DeviceImageBean {
  List<String>? _files;
  String? _folderName;

  List<String>? get files => _files;
  String? get folderName => _folderName;

  DeviceImageBean(this._files, this._folderName);

  DeviceImageBean.map(dynamic obj) {
    _files = obj["files"];
    _folderName = obj["folderName"];
  }

  DeviceImageBean.fromJson(Map<String, dynamic> json) {
    _files = json['files'].cast<String>();
    _folderName = json['folderName'];
  }
  Map<String, dynamic> toMap() {
    var map = <String, dynamic>{};
    map["files"] = _files;
    map["folderName"] = _folderName;
    return map;
  }

}